import { Box } from "@mui/material";
import React from "react";

const Descriptionabus = () => {
  return (
    <Box
      className="ph"
      style={{
        marginTop: "120px",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        backgroundColor: "#F3ECB0",
      }}
    >
      <Box
        style={{
          color: "white",
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
          maxWidth: "1580px",
          overflow: "auto",
        }}
      >
        <h2>Welcome to Kiddos Tradezz,</h2>
        <p>
          the online toy sales and trading platform that brings parents and
          children together! We are a community of toy enthusiasts who love
          sharing and discovering new treasures. Our marketplace offers a wide
          selection of quality toys for kids of all ages. We pride ourselves on
          providing a safe and fun environment for kids to swap their favorite
          toys with other kids. At Kiddos Tradezz, we believe that every toy has
          a story and we're here to help create unforgettable memories. Join our
          community today and discover a new way to play with Kiddos Tradezz!
        </p>
      </Box>
    </Box>
  );
};

export default Descriptionabus;
